function getMsg(name, senderID) {
    //Tin nhắn sẽ được gửi vào nhóm mà người dùng đã dùng lệnh match và tag người dùng đó để nhắc nhở.
    //Sửa body thì được chứ đừng sửa gì khác, phần mentions là để Bot tag người đang chờ.
    //Cũng có thể thêm attachments cho tin nhắn thông báo này thêm sinh động.
    return {
        body: `Hey, ${name}~\nHệ thống đã match được một người và ghép với bạn ^^\n\nVui lòng kiểm tra tin nhắn của Bot vừa gửi cho bạn. Nếu không thấy, hãy kiểm tra trong thư mục spam hoặc tin nhắn chờ!`,
        mentions: [
            {
                tag: name,
                id: senderID
            }
        ]
    };
}

function getFirstNoti(data) {
    //Tin nhắn sẽ được gửi đến người dùng đó khi được match thành công.
    return {
        body: `Bạn vừa được ghép với một người lạ ^^\n\nHãy gửi tin nhắn đầu tiên chào cậu ấy và nói chuyện với nhau một cách lịch sự nhé ^^`
    }
}

